import React from "react";
import {NavBlock, NavListItem, NavListItemMenu, NavListItemMenuItem, NavListItemMenuItemMenu} from "./styles";

const navItem = [
    {
        mainMenu: "아이템1",
        subMenu: [
            {
                name: "product",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    },
    {
        mainMenu: "아이템2",
        subMenu: [
            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    },
    {
        mainMenu: "아이템3",
        subMenu: [
            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    },
    {
        mainMenu: "아이템4",
        subMenu: [
            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품2",
                path: "#"
            },
            {
                name: "상품3",
                path: "#"
            }]
    }
];

const Nav = () => {
    return (
        <NavBlock>
            {navItem.map(item => (
                    <NavListItem>
                        <NavListItemMenu>{item.mainMenu}
                            <NavListItemMenuItem>
                                {item.subMenu.map(sub => (
                                    <NavListItemMenuItemMenu>
                                        {sub.name}
                                    </NavListItemMenuItemMenu>
                                ))}
                            </NavListItemMenuItem>
                        </NavListItemMenu>
                    </NavListItem>
                )
            )}

        </NavBlock>
    )
};
export default Nav
